# Render bubbles
bubble_html = ""
for _ in range(10):
    size = random.randint(30, 80)
    left = random.randint(0, 100)
    dur = random.randint(18, 30)
    bubble_html += "<div class='bubble' style='width:{}px;height:{}px;left:{}%;animation-duration:{}s'></div>".format(size, size, left, dur)

st.markdown(bubble_html, unsafe_allow_html=True)

st.markdown("<div class='dashboard'>", unsafe_allow_html=True)

st.title(" AI Mood-Based Movie Recommender")
st.caption("Personalized movie suggestions based on your current mood")

df = load_data("db/movies.csv")
moods = sorted(df['emotion'].dropna().unique().tolist())

st.markdown("###  Select your mood")
mood = st.selectbox("", moods)

st.markdown("###  Number of recommendations")
max_movies = st.slider("", 5, 50, 10)

if st.button(" Recommend Movies"):
    results = recommend(df, mood, top_n=max_movies)
    for _, r in results.iterrows():
        st.markdown("<div class='movie-card'>", unsafe_allow_html=True)
        st.subheader(" " + str(r['title']))
        st.write(str(r['description']))
        st.info(explain(str(r['emotion']), mood))
        st.success(gpt_explain(str(r['title']), mood))
        st.markdown("</div>", unsafe_allow_html=True)

st.markdown("</div>", unsafe_allow_html=True)
